import React from "react";
import ReactDOM from "react-dom";
import "antd/dist/antd.css";
import "./index.css";
import { Table, Tag, Space } from "antd";

const columns = [
  {
    title: "Name",
    dataIndex: "name",
    key: "name",
    render: (text) => <a>{text}</a>,
  },
  {
    title: "Age",
    dataIndex: "age",
    key: "age",
  },
  {
    title: "Address",
    dataIndex: "address",
    key: "address",
  },
  {
    title: "Tags",
    key: "tags",
    dataIndex: "tags",
    render: (tags) => (
      <>
        {tags.map((tag) => {
          let color = tag.length > 5 ? "geekblue" : "green";
          if (tag === "loser") {
            color = "volcano";
          }
          return (
            <Tag color={color} key={tag}>
              {tag.toUpperCase()}
            </Tag>
          );
        })}
      </>
    ),
  },
  {
    title: "Action",
    key: "action",
    render: (text, record) => (
      <Space size="middle">
        <a>Invite {record.name}</a>
        <a>Delete</a>
      </Space>
    ),
  },
];

const data = [
  {
    key: "1",
    device_ip_addr: "192.168.1.100",
    mac_addr: "255.255.255.0",
    hostname: "PC-1001",
    device_type: "Workstation",
  },
  {
    key: "2",
    device_ip_addr: "192.168.1.100",
    mac_addr: "255.255.255.0",
    hostname: "PC-1001",
    device_type: ["nice", "developer"],
  },
  {
    key: "3",
    device_ip_addr: "192.168.1.100",
    mac_addr: "255.255.255.0",
    hostname: "PC-1001",
    device_type: ["nice", "developer"],
  },
];

function Help() {
  return (
    <div>
      <Table dataSource={data}>
        <Column
          title="IP Address"
          dataIndex="device_ip_addr"
          key="device_ip_addr"
        />
        <Column title="Mac Address" dataIndex="mac_addr" key="mac_addr" />
        <Column title="Hostname" dataIndex="hostname" key="hostname" />
        <Column
          title="Device Type"
          dataIndex="device_type"
          key="device_type"
          render={(tags) => (
            <>
              {tags.map((tag) => (
                <Tag color="blue" key={tag}>
                  {tag}
                </Tag>
              ))}
            </>
          )}
        />
        <Column
          title="Action"
          key="action"
          render={(text, record) => (
            <Space size="middle">
              <a>Edit Device</a>
              <a>Remove</a>
            </Space>
          )}
        />
      </Table>
    </div>
  );
}

export default Help;
